import React from 'react';

const DetalPost = ({ post }) => {
  const { title, desc } = post;
  return (
    <li className="shadow-2xl p-4 bg-white hover:bg-slate-300 relative w-[1000px]">
      <h1 className="text-5xl font-bold">{title}</h1>
      <p className="text-xl mt-2">{desc}</p>
      <button className="absolute top-[10px] right-[20px] text-red-600 text-4xl" type="submit" onClick={()=>dispatch(deletePost())}>
        x
      </button>
    </li>
  );
};

export default DetalPost;
